import React from "react";

import {Navbar,Nav,Container} from 'react-bootstrap';
import "./SearchStyles.css"

const Header= props=>{
  const stylling= {
    background: "rgb(12,237,26)",
    background: "linear-gradient(90deg, rgba(12,237,26,1) 0%, rgba(115,223,10,0.6730042358740371) 22%, rgba(39,249,5,0.16880255520176823) 100%, rgba(1,255,0,1) 100%)"
    
    }
    return(
      <>
      
      <div className="Navbar" style={stylling}>
      <Navbar collapseOnSelect expand="lg"  variant="dark">
        <Container>
          <Navbar.Brand >Football</Navbar.Brand>
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link href="#Home">Home</Nav.Link>
              <Nav.Link href="#Teams">Teams</Nav.Link>
              <Nav.Link href="#Venues">Venues</Nav.Link>
              <Nav.Link href="#Refrees">Refrees</Nav.Link>
            </Nav>
            <Nav>
              <Nav.Link eventKey={2} href="#logout">Logout</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      </div>
      </>
    );
};
export default Header;
